Craig Ferguson: I'm Here to Help (2013) (WEB-DL - XviD) [UNRATED]
-------------------------------------------------------

Craig Ferguson wants to tell a joke. And he'll try to finish the joke.
But he may not remember to get to the punchline, because he's distracted
by hysterical thoughts of fatherhood, Helen of Troy, and shark penises.
The host of CBS's The Late Late Show unleashes his trademark
stream-of-consciousness comedy before a sold-out Washington, DC crowd.
Definitely not for children. Or the easily offended. Or Mel Gibson.

Actor: Craig Ferguson.
Producers: Craig Ferguson, Phil Cottone and Ian Kornbluth.
Director: Jay Chapman.

Produced by Green Mountain West and New Wave Entertainment.

